import './App.css';
import React from 'react';

class App extends React.Component {
  render () {
    return (
      <div>
        <h1> Formulário em React: Componentes Controlados</h1>
        <form>
          <label> Name:
            <input type='name'></input>
          </label>
          <label> Email:
            <input type='email'></input>
          </label>

        </form>
      </div>
    )
  }

}

export default App;
